import { Link } from "react-router-dom";
import styled from "@emotion/styled";

import { Keyboard } from "./keyboard";
import { Back } from "./back";

export default function Login() {
  return (
    <>
      <BackButton>
        <Back />
      </BackButton>
      <Container>
        <div>
          <SvgBox>
            <Keyboard />
          </SvgBox>
          <Title>최재열 멍청이</Title>
          <SubTitle>들어보고 구매하는 키보드 스토어</SubTitle>
        </div>
        <>
          <Username placeholder="아이디를 입력해 주세요" />
          <Password placeholder="비밀번호를 입력해 주세요" />
        </>
        <Button to="/list">로그인</Button>
      </Container>
    </>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100%;
`;

const BackButton = styled.div`
  position: absolute;
  top: 23px;
  left: 23px;
  width: 30px;
`;

const SvgBox = styled.div`
  width: 200px;
`;

const Title = styled.div`
  font-weight: bold;
  font-size: 20px;
  text-align: center;
`;

const SubTitle = styled.div`
  margin-top: 12px;
  font-weight: bold;
  font-size: 12px;
  text-align: center;
`;

const Username = styled.input`
  margin-top: 30px;
  padding: 0 15px;
  width: 250px;
  height: 40px;
  border: none;
  outline: none;
  border-radius: 15px;
`;

const Password = styled.input`
  margin-top: 10px;
  padding: 0 15px;
  width: 250px;
  height: 40px;
  border: none;
  outline: none;
  border-radius: 15px;
`;

const Button = styled(Link)`
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 20px 0;
  width: 250px;
  height: 50px;
  border: 1px solid white;
  border-radius: 25px;
  background-color: black;
  color: white;
  font-weight: bold;
  font-size: 14px;
  text-decoration: none;
  cursor: pointer;

  &:active {
    background-color: white;
    color: black;
  }
`;
